      name: 'Walter White',
      position: 'Bryan Cranston',
      phone: '+49 12345678',
      email: 'walter@b-bad.com',
      website: 'walterwhite.com',
    },
    {
      id: 3,
      img: '/images/03.jpg',
      name: 'Skyler White',
      position: 'Anna Gunn',
      phone: '+49 12345678',
      email: 'skyler@b-bad.com',
