      img: '/images/05.jpg',
      name: 'Saul Goodman',
      position: 'Bob Odenkirk',
      phone: '+49 12345678',
      email: 'saul@b-bad.com',
    },
    {
      id: 4,
      img: '/images/04.jpg',
      name: 'Gus Fring',
      position: 'Giancarlo Esposito',
      phone: '+49 12345678',
      email: 'gus@b-bad.com',
    },
    {
      id: 2,
      img: '/images/06.jpg',
      name: 'Hank Schrader',
      position: 'Dean Norris',
      phone: '+49 12345678',
      email: 'hank@b-bad.com',
    },
  ];

  return (
    <div className="row">
      {info.map((member) => (
        <TeamMember key={member.id} member={member} />
      ))}
    </div>
  );
}

export default Team;
